INSERT INTO `cache_extensions` VALUES ('cal', '1', '0.15.0', '38770', '707', 'Calendar Base', 'A calendar combining all the functions of the existing calendar extensions plus adding some new features. It is based on the ical standard', '1', '-1', '3', '1176933962', 'a:1:{s:7:\"depends\";a:2:{s:3:\"php\";s:11:\"4.0.0-0.0.0\";s:5:\"typo3\";s:12:\"3.8.0-4.1.99\";}}', 'Mario Matzulla, Jeff Segars', 'mario@matzullas.de, jeff@webempoweredchurch.org', 'mario_matzulla', 'de885572399f746c0808a2251fb588ce', 'Major updates for recurring events and search.\n Lots of improvements to backend usability.\n Added calendar and category filtering from Flexform and Typoscript.\n Added stdWrap support in many places.', '', '15000', '0', '0');
INSERT INTO `cache_extensions` VALUES ('cal', '1', '0.15.1', '38770', '1058', 'Calendar Base', 'A calendar combining all the functions of the existing calendar extensions plus adding some new features. It is based on the ical standard', '1', '-1', '3', '1179158558', 'a:1:{s:7:\"depends\";a:2:{s:3:\"php\";s:11:\"4.0.0-0.0.0\";s:5:\"typo3\";s:12:\"3.8.0-4.1.99\";}}', 'Mario Matzulla, Jeff Segars', 'mario@matzullas.de, jeff@webempoweredchurch.org', 'mario_matzulla', '6e3fd3a8059cfd3eb0d7d13b3a8b396d', 'Fixes for various timezone bugs, both backend and frontend. \n\nBackend usability enhancements, including major update to exception events.\n\nImproved custom marker functionality.\n\nLots of minor bugfixes throughout the extension.', '', '15001', '0', '0');
